// Update does not automatically update the record in case of default values. Use .Reload() to refresh the records.
func (o *BookingReminder) Update(ctx context.Context, exec boil.ContextExecutor, columns boil.Columns) (int64, error) {
	var err error
	if err = o.doBeforeUpdateHooks(ctx, exec); err != nil {
		return 0, err
	}
	key := makeCacheKey(columns, nil)
	bookingReminderUpdateCacheMut.RLock()
	cache, cached := bookingReminderUpdateCache[key]
	bookingReminderUpdateCacheMut.RUnlock()

	if !cached {
		wl := columns.UpdateColumnSet(
			bookingReminderAllColumns,
			bookingReminderPrimaryKeyColumns,
		)

		if !columns.IsWhitelist() {
			wl = strmangle.SetComplement(wl, []string{"created_at"})
		}
		if len(wl) == 0 {
			return 0, errors.New("pgmodel: unable to update booking_reminder, could not build whitelist")
		}

		cache.query = fmt.Sprintf("UPDATE \"booking_reminder\" SET %s WHERE %s",
			strmangle.SetParamNames("\"", "\"", 1, wl),
			strmangle.WhereClause("\"", "\"", len(wl)+1, bookingReminderPrimaryKeyColumns),
		)
		cache.valueMapping, err = queries.BindMapping(bookingReminderType, bookingReminderMapping, append(wl, bookingReminderPrimaryKeyColumns...))
		if err != nil {
			return 0, err
		}
	}

	values := queries.ValuesFromMapping(reflect.Indirect(reflect.ValueOf(o)), cache.valueMapping)

	if boil.IsDebug(ctx) {
		writer := boil.DebugWriterFrom(ctx)
		fmt.Fprintln(writer, cache.query)
		fmt.Fprintln(writer, values)
	}
	var result sql.Result
	result, err = exec.ExecContext(ctx, cache.query, values...)
	if err != nil {
		return 0, errors.Wrap(err, "pgmodel: unable to update booking_reminder row")
	}

	rowsAff, err := result.RowsAffected()
	if err != nil {
		return 0, errors.Wrap(err, "pgmodel: failed to get rows affected by update for booking_reminder")
	}

	if !cached {
		bookingReminderUpdateCacheMut.Lock()
		bookingReminderUpdateCache[key] = cache
		bookingReminderUpdateCacheMut.Unlock()
	}

	return rowsAff, o.doAfterUpdateHooks(ctx, exec)
}

